// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

/**
 * @title InvestmentRound
 * @dev Contrato para registrar a assinatura de termos de investimento em uma rodada.
 * Serve como a "fonte de verdade" on-chain para os termos do acordo
 * e a lista de investidores, enquanto a execução financeira é off-chain.
 * Implantado e controlado pelo tomador da rodada.
 */
contract InvestmentRound {

    // --- Variáveis de Estado ---
    address public immutable borrower;
    // Alterado para bytes32 para ser compatível com "immutable"
    bytes32 public immutable roundNameHash;
    bytes32 public immutable termsHash;
    bool public roundOpen;

    struct Investor {
        uint256 amount; // Quantia investida (em Wei)
    }

    mapping(address => Investor) public investors;
    uint256 public investorCount;

    // --- Modificadores ---
    modifier onlyBorrower() {
        require(msg.sender == borrower, "Only the borrower can call this function.");
        _;
    }

    // --- Construtor ---
    /**
     * @dev Executado na implantacao do contrato. Define o tomador e os termos da rodada.
     * @param _roundNameHash Hash do nome da rodada (ex: keccak256 de "Rodada Pre-Seed v1").
     * @param _termsHash Hash do documento de termos do acordo (ex: keccak256 de um PDF/JSON).
     */
    constructor(bytes32 _roundNameHash, bytes32 _termsHash) {
        borrower = msg.sender;
        roundNameHash = _roundNameHash;
        termsHash = _termsHash;
        roundOpen = true; // A rodada comeca aberta para assinaturas
    }

    // --- Funcoes de Acao ---
    /**
     * @dev Permite que um investidor assine os termos e registre sua participacao.
     * Nao e necessario que o valor enviado seja o valor real do investimento, pois a logica financeira
     * e gerenciada off-chain. O `msg.value` serve como uma prova de vida e para registrar a quantia simbólica.
     */
    function signTerms() external payable {
        require(roundOpen, "Round is closed and cannot accept new investors.");
        require(msg.value > 0, "Amount must be greater than zero.");
        require(investors[msg.sender].amount == 0, "You have already signed the terms.");

        investors[msg.sender] = Investor({
            amount: msg.value
        });
        investorCount++;
    }

    /**
     * @dev Funcao para o tomador fechar a rodada, impedindo novas assinaturas.
     * Isso garante que a lista de investidores para esta rodada seja final.
     */
    function closeRound() external onlyBorrower {
        require(roundOpen, "Round is already closed.");
        roundOpen = false;
    }

    // --- Funcoes de Visualizacao de Dados ---
    /**
     * @dev Retorna o hash dos termos do contrato.
     */
    function getTermsHash() external view returns (bytes32) {
        return termsHash;
    }

    /**
     * @dev Retorna o estado da rodada (aberta/fechada).
     */
    function getRoundStatus() external view returns (bool) {
        return roundOpen;
    }

    /**
     * @dev Retorna o numero de investidores que ja assinaram.
     */
    function getInvestorCount() external view returns (uint256) {
        return investorCount;
    }

    /**
     * @dev Retorna a quantia investida por um endereco especifico.
     * @param _investor O endereco do investidor.
     */
    function getInvestorInfo(address _investor) external view returns (uint256) {
        return investors[_investor].amount;
    }
}

